from functools import cache

class Solution:
    @cache
    def numDistinct(self, s: str, t: str) -> int:
        if len(s) == len(t):
            if t == s:
                return 1
            else:
                return 0
        if t == "":
            return 1
        if s == "":
            return 0
        if s[-1] == t[-1]:
            nd1 = self.numDistinct(s[:-1], t)
            nd2 = self.numDistinct(s[:-1], t[:-1])
            ans = nd1 + nd2
        else:
            ans = self.numDistinct(s[:-1], t)
        return ans

import sys
sys.setrecursionlimit(10000)
data = [
""
, ""
]
r = Solution().numDistinct(* data)
print(r)